<script>
import CountTo from 'vue-count-to'
import { mapActions, mapGetters } from 'vuex'

export default {
  name: 'Badges',
  data () {
    return {
      loading: false
    }
  },
  components: {
    CountTo
  },
  computed: {
    ...mapGetters({
      dashboard: 'app/dashboard'
    }),
    balance () {
      return this.dashboard.balance || 0
    },

    total() {
      return this.dashboard?.total_products || '-'
    },

    expire() {
      const expire =
        (this.dashboard?.package_expire_date_cute &&
          this.dashboard?.package_expire_date) ||
        ''
      return expire
        ? `${this.dashboard.package_expire_date_cute} ( ${this.dashboard.package_expire_date} )`
        : ''
    }
  },
  methods: {
    ...mapActions({
      BUY_REQUESTS: 'packages/BUY_REQUESTS'
    }),
    handleSetLineChartData (type) {
      this.$emit('handleSetLineChartData', type)
    },
    async buyRequests () {
      this.loading = true

      await this.BUY_REQUESTS()
        .then(response => {
          if (response.status) {
            window.location.href = response.redirect
          }
        })
        .finally(() => {
          this.loading = false
          this.dialogVisible = false
        })
    }
  }
}
</script>

